// filepath: frontend/src/Dashboard.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';

const Dashboard = () => {
    const [users, setUsers] = useState([]);
    const [licenses, setLicenses] = useState({});
    const [newUser, setNewUser] = useState({ id: '', name: '', email: '' });
    const [updateUser, setUpdateUser] = useState({ id: '', name: '', email: '' });
    const [removeUserId, setRemoveUserId] = useState('');

    // Fetch users and license info
    useEffect(() => {
        axios.get('/api/slack/users.list').then(res => setUsers(res.data));
        axios.get('/api/slack/license.info').then(res => setLicenses(res.data));
    }, []);

    // Add a new user
    const handleAddUser = () => {
        axios.post('/api/slack/users.add', newUser).then(res => {
            setUsers([...users, res.data]);
            setNewUser({ id: '', name: '', email: '' });
        });
    };

    // Remove a user
    const handleRemoveUser = () => {
        axios.delete(`/api/slack/users.remove?user=${removeUserId}`).then(() => {
            setUsers(users.filter(user => user.id !== removeUserId));
            setRemoveUserId('');
        });
    };

    // Update a user
    const handleUpdateUser = () => {
        axios.put('/api/slack/users.update', updateUser).then(res => {
            setUsers(users.map(user => (user.id === res.data.id ? res.data : user)));
            setUpdateUser({ id: '', name: '', email: '' });
        });
    };

    return (
        <div>
            <h1>Slack Mock API Dashboard</h1>

            <h2>License Info</h2>
            <p>Total Licenses: {licenses.totalLicenses}</p>
            <p>Used Licenses: {licenses.usedLicenses}</p>

            <h2>Users</h2>
            <ul>
                {users.map(user => (
                    <li key={user.id}>
                        {user.name} ({user.email})
                    </li>
                ))}
            </ul>

            <h2>Add User</h2>
            <input
                type="text"
                placeholder="ID"
                value={newUser.id}
                onChange={e => setNewUser({ ...newUser, id: e.target.value })}
            />
            <input
                type="text"
                placeholder="Name"
                value={newUser.name}
                onChange={e => setNewUser({ ...newUser, name: e.target.value })}
            />
            <input
                type="email"
                placeholder="Email"
                value={newUser.email}
                onChange={e => setNewUser({ ...newUser, email: e.target.value })}
            />
            <button onClick={handleAddUser}>Add User</button>

            <h2>Remove User</h2>
            <input
                type="text"
                placeholder="User ID"
                value={removeUserId}
                onChange={e => setRemoveUserId(e.target.value)}
            />
            <button onClick={handleRemoveUser}>Remove User</button>

            <h2>Update User</h2>
            <input
                type="text"
                placeholder="ID"
                value={updateUser.id}
                onChange={e => setUpdateUser({ ...updateUser, id: e.target.value })}
            />
            <input
                type="text"
                placeholder="Name"
                value={updateUser.name}
                onChange={e => setUpdateUser({ ...updateUser, name: e.target.value })}
            />
            <input
                type="email"
                placeholder="Email"
                value={updateUser.email}
                onChange={e => setUpdateUser({ ...updateUser, email: e.target.value })}
            />
            <button onClick={handleUpdateUser}>Update User</button>
        </div>
    );
};

export default Dashboard;
